INSERT INTO `collection` VALUES (1,'Default Collection','No Description'),(14,'libMesh FEM','A collection of finite element method problems based on the libMesh library. \nThe \n<a href=\"http://libmesh.sourceforge.net/\">libMesh Library</a> can be downloaded freely from SourceForge. '),(16,'NLEVP','NLEVP: A Collection of Nonlinear Eigenvalue Problems\n\nThis generator collection provides a collection of nonlinear eigenvalue problems. It contains problems from models of real-life applications as well as problems constructed specifically to have particular properties. \n\nMore info can be found at:<br>\n<a href=\"http://www.mims.manchester.ac.uk/research/numerical-analysis/nlevp.html\">http://www.mims.manchester.ac.uk/research/numerical-analysis/nlevp.html</a>'),(17,'HP3D','The hp3d solvers solve the Poisson problem on the Fichera domain. The Dirichlet boundary condition on the L-shaped sides is (in local coordinates):\n<br>\n<image src=\"Images/HP3D/eq0000M.gif\">\n<br>\nThe solution has a singularity along the re-entrant edges and corner, which requires adaptive refinement of the mesh and increase in the polynomial degree of the elements.\n<br>\n<image width=\"200\" src=\"Images/HP3D/fichera_sol.png\"><br>'),(19,'The Matrix Computation Toolbox','A collection of MATLAB M-files containing functions for constructing test matrices'),(22,'MGF','<span id=\"MPDpiSpan\"></span>\r\n\r\n\r\n<script language=\"javascript\">\r\nMPBodyInit(\'Images/MGF\')\r\n</script>\r\n<!-- )MP BODY -->\r\n\r\n\r\n<p style=\"width:25em;\">MGF solves the time-dependent version of the convection\r\ndiffusion equation</p>\r\n\r\n<p style=\"width:25em;\";>\r\n<img src=\"Images/MGF/eq0000M.gif\">\r\n\r\n                     <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">on</span>\r\n<img src=\"Images/MGF/eq0001M.gif\">\r\n</p>\r\n\r\n<p style=\"width:25em\">\r\n\r\n<img src=\"Images/MGF/eq0002M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">on</span>\r\n<img src=\"Images/MGF/eq0003M.gif\">\r\n</p>\r\n\r\n\r\n<img src=\"Images/MGF/eq0004M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">on</span>\r\n<img src=\"Images/MGF/eq0005M.gif\">\r\n</p>\r\n\r\n\r\n\r\n<p class=\"MTDisplayEquation\">where</p>\r\n\r\n<p><img src=\"Images/MGF/eq0006M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">is density, fixed</span><p>\r\n\r\n<p><img src=\"Images/MGF/eq0007M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">is specific heat, fixed</span><p>\r\n\r\n<p><img src=\"Images/MGF/eq0008M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">is thermal conductivity, parameter</span><p>\r\n\r\n<p><img src=\"Images/MGF/eq0009M.gif\">\r\n <span style=\"display:inline-block;margin-right:1em; margin-left:1em;\">is imposed velocity, parameter</span><p>\r\n\r\n'),(23,'Defiant','A finite-difference reservoir simulation toolkit based on PETSc that uses finite difference discretization of the muliphase flow through media equations.'),(24,'FEniCS','The FEniCS Project is a collection of free software aimed at automated, efficient solution of differential equations. The project provides tools for working with computational meshes, finite element variational formulations of PDEs, ODE solvers and linear algebra.\r\n'),(27,'Victor test','just tinkering'),(28,'New Name','Describe this'),(29,'New Name','DESCRIPTION'),(30,'New Name','dsafsafs'),(31,'Carrie','My collection');
