INSERT INTO `generator` VALUES (79,'','Laplace FEM Generator','<a href=\"Images/libMesh/holey.png\"><img src=\"Images/libMesh/holey.png\" width=\"350\"></a>\n<br />\n(Above: Picture of a Laplacian solution on a domain with holes)',0,14,0),(80,'','Navier-Stokes FEM Generator','\n\n<p class=MsoNormal>The Navier-Stokes generator solves the problem</p>\n\n<br>\n<img src=\"Images/libMesh/eq0000M.gif\">\n<br>\n<img src=\"Images/libMesh/eq0001M.gif\">',0,14,1),(153,'','Acoustic Wave','		    <span>\r\n		    Constructs the matrix polynomial lambda^2*M + lambda*D + K that arises from\r\n		    the discretization by finite elements of a two-dimensional acoustic\r\n		    wave equation. The coefficient matrices are N-by-N with\r\n		    N = N1*(N1-1), H  = 1/N1 being the mesh size.  The damping matrix has the\r\n		    form Z^(-1)*D, where D is a low rank real symmetric matrix and\r\n		    the scalar parameter Z is the impedance (possibly complex).\r\n		    The default values are N1 = 6 (N = 30) and Z = 1.\r\n		    The matrices are returned in a cell array: COEFFS = {K, D, M};\r\n	   	    This problem has the properties pep, qep, real symmetric,\r\n		    parameter-dependent, scalable.\r\n		    </span>\r\n		    <span style=\"margin-top:2em; display:block;\">\r\n		    Reference:\r\n		    F. Chaitin-Chatelin and M. B. van Gijzen, Analysis of parameterized\r\n		    quadratic eigenvalue problems in computational acoustics with homotopic\r\n		    deviation theory, Numer. Linear Algebra Appl. 13 (2006), pp. 487--512</span>',0,16,0),(154,'','Bicycle','	        <span>\r\n	        Constructs a 2-by-2 quadratic matrix\r\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\r\n	        study of the dynamic behaviour of a bicycle.\r\n	        v (default 5) is the forward speed in m/s.\r\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\r\n	        This problem has the properties pep, qep, real, parameter_dependent.\r\n		</span>\r\n		    <span style=\"margin-top:2em; display:block;\">\r\n	        Reference:\r\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\r\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\r\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\r\n		</span>',0,16,0),(155,'','Bilby','		  <span>\r\n		  5-by-5 QEP from Bilby population model.\r\n		  Constructs a 5-by-5 quadratic matrix\r\n		  polynomial lambda^2*A + lambda*B + C arising in a\r\n		  quasi-birth-death process model of the population of the greater bilby,\r\n		  an endangered Australian marsupial.  A and C are both singular.\r\n		  BETA is a parameter (default: 0.5).		  \r\n		  This problem has the properties pep, qep, real, parameter-dependent.\r\n		  </span>\r\n		  \r\n		  		    <span style=\"margin-top:2em; display:block;\">\r\n		  Reference:\r\n		  N. J. Higham and H.-M. Kim, Numerical analysis of a quadratic\r\n		  matrix equation, IMA J. Numer. Anal., 20(4): 499-519, 2000.\r\n		  </span>',0,16,0),(156,'','Butterfly','		  <span>\r\n		  Quartic matrix polynomial with T-even structure.\r\n		  COEFFS = NLEVP(\'butterfly\',M,C) generates the coefficient matrices of a\r\n		  M^2-by-M^2 quartic matrix polynomial\r\n		  P(\\lambda) = lambda^4*A_4 + lambda^2*A_3 +  lambda^2*A_2 + lambda*A_1 + A_0\r\n		  for which A_4 and A_2 are real and symmetric and\r\n		  A_3 and A_1 are real and skew-symmetric (assuming C is real).\r\n		  The spectrum has a butterfly shape.\r\n		  The default is M = 8.  C is an 10-by-1 vector of parameters.\r\n		  The matrices are returned in a cell array: COEFFS = {A0, A1, A2, A3, A4}.\r\n		  This problem has the properties pep, real, parameter-dependent, T-even,\r\n		  scalable.\r\n		  </span>\r\n		  \r\n		    <span style=\"margin-top:2em; display:block;\">\r\n	          Reference:\r\n		  V. Mehrmann and D. Watkins. Polynomial eigenvalue problems with\r\n		  Hamiltonian structure. Electron. Trans. Numer. Anal., 13:106-118, 2002.\r\n		  </span>',0,16,0),(157,'','CD Player','	    <span>\r\n	    QEP from model of CD player.\r\n	    Constructs a 60-by-60 quadratic matrix\r\n	    polynomial lambda^2*M + lambda*D + K arising in the\r\n	    study of a CD player control task.\r\n	    The matrices are returned in a cell array: COEFFS = {K, D, M}.\r\n	    This problem has the properties pep, qep, real.\r\n	    </span>\r\n		    <span style=\"margin-top:2em; display:block;\">\r\n	    Reference:\r\n	    Y. Chahlaoui and P. M. Van Dooren. A collection of benchmark examples\r\n	    for model reduction of linear time invariant dynamical systems.\r\n	    MIMS EPrint 2008.22, Manchester Institute for Mathematical Sciences,\r\n	    The University of Manchester, UK, 2002.\r\n	    </span>',0,16,0),(158,'','Closed Loop','		  <span>\r\n		  2-by-2 QEP associated with closed-loop control system.\r\n		  Constructs a 2-by-2 quadratic\r\n		  matrix polynomial lambda^2*A2 + lambda*A1 + A0 associated with a\r\n		  closed-loop control system with feedback gains 1 and 1+ALPHA.\r\n		  For 0 < ALPHA < 0.875 all eigenvalues lie inside the unit disc.\r\n		  The default is ALPHA = 1. The matrices are returned in a cell array:\r\n		  COEFFS = {A0, A1, A2}.\r\n		  This problem has the properties pep, qep, real, parameter_dependent.\r\n		  </span>\r\n\r\n		    <span style=\"margin-top:2em; display:block;\">\r\n		  Reference:\r\n		  Francoise Tisseur and Nicholas J. Higham. Structured pseudospectra for\r\n		  polynomial eigenvalue problems, with applications. SIAM J. Matrix\r\n		  Anal. Appl., 23(1):187-208, 2001.\r\n		  </span>',0,16,0),(159,'','Concrete','	     <span>\r\n	           Sparse QEP from model of a concrete structure.\r\n	           COEFFS = NLEVP(\'concrete\',mu) generates the coefficient matrices of a\r\n	           quadratic matrix polynomial lambda^2*C + lambda*B + A arising in a\r\n                   model of a concrete structure supporting a machine assembly.\r\n	           This problem is complex symmetric and has dimension 2472.\r\n	           The matrices are sparse.\r\n	           <ul>\r\n		   <li>C = mass matrix, real diagonal, low rank.\r\n		   <li>B = viscous damping matrix, purely imaginary\r\n		       and diagonal, B = i*C_v, low rank.\r\n		   <li>A = stiffness + uniform hysteretic damping\r\n		       matrix, A = (1 + i*mu)*K, mu = 0.04.\r\n		   </ul>\r\n		   This problem has the properties pep, qep, symmetric, parameter-dependent,\r\n		   sparse.\r\n	    </span>\r\n		    <span style=\"margin-top:2em; display:block;\">\r\n	    Reference:\r\n              	   A. Feriani, F. Perotti and V. Simoncini,\r\n		   Iterative system solvers for the frequency analysis of\r\n		   linear mechanical systems,\r\n		   Computer Methods in Appl. Mech. Eng., 190 (2000) pp. 1719-1739.\r\n	    </span>',0,16,0),(160,'','Damped Beam','		\r\n		  <span>\r\n		  QEP from simply supported beam damped in the middle.\r\n		  COEFFS = NLEVP(\'damped_beam\',NELE) constructs an N-by-N (N = 2*NELE)\r\n		  quadratic matrix polynomial lambda^2*M + lambda*D + K from a finite\r\n		  element model of a beam clamped at both ends with a damper in the middle.\r\n		  NELE (default NELE = 100) is the number of finite elements (even).\r\n		  Half of the eigenvalues of the problem are pure imaginary\r\n		  and are eigenvalues of the undamped problem (D = 0).\r\n		  The matrices are returned in a cell array: COEFFS = {K, D, M}.\r\n		  This problem has the properties pep, qep, real, symmetric, scalable.\r\n		  </span>		    <span style=\"margin-top:2em; display:block;\">\r\n		  Reference:\r\n      		  N. J. Higham, D. S. Mackey, F. Tisseur and S. D. Garvey.\r\n		  Scaling, sensitivity and stability in the numerical solution of\r\n		  quadratic eigenvalue problems. Internat. J. Numer. Methods Eng.,\r\n		  73(3):344-360, 2008.\r\n		  </span>',0,16,0),(161,'','Dirac','		  <span>\r\n		  Generates the coefficient matrices of a quadratic matrix polynomial lambda^2*A + lambda*B + C of dimension\r\n		  N + M.  The spectrum\r\n		  of this matrix polynomial is the second order spectrum of the\r\n		  Dirac operator with an electric Coulombic potential,\r\n		  relative to the subspace generated by the Hermite functions of odd order.\r\n		  The potential is attractive and of strength ALPHA where\r\n		  -SQRT(3)/2 < ALPHA < 0.\r\n		  The constant KAPPA (which should be an integer) corresponds\r\n		  to a radially symmetric decomposition of the space into partial wave\r\n		  subspaces.  In this decomposition, the operator acts on\r\n		  L^2(0,\\infty)xL^2(0,\\infty). The matrix truncation is found by\r\n		  picking N Hermite functions in the first component and M in the second\r\n		  component. By default N = M = 40, KAPPA = -1, and ALPHA = -1/2.\r\n		  The matrices are returned in a cell array: COEFFS = {C, B, A}.\r\n		  This problem has the properties pep, qep, real, symmetric,\r\n		  parameter-dependent, scalable.\r\n		  </span>\r\n		  \r\n		 		    <span style=\"margin-top:2em; display:block;\">\r\n		  Reference:\r\n		  L. Boulton and N. Boussaid, On approximation of the eigenvalues of the\r\n		  Dirac operator, Preprint, 2008\r\n		  </span>\r\n',0,16,0),(162,'','Gun','	    <span>\r\n	    NEP from model of a radio-frequency gun cavity.\r\n	    Returns 9956-by-9956 matrices\r\n	    K, M, W1 and W2 for the nonlinear eigenvalue problem defined by\r\n	    T(lam)*x = [K-lam*M+i*lam^(1/2)*W1+i*(lam-108.8774^2)^(1/2)*W2]x = 0.\r\n	    The matrices are returned in a cell array: COEFFS = {K,M,W1,W2}.\r\n	    This problem has the properties nep, sparse.\r\n	      </span>		    <span style=\"margin-top:2em; display:block;\">\r\n	    References:\r\n	    Ben-Shan Liao, Subspace projection methods for model order reduction and\r\n	    nonlinear eigenvalue computation, Ph.D Thesis, Department of Mathematics,\r\n	      University of California at Davis, 2007\r\n	      </span>',0,16,0),(163,'','Hospital','	    <span>\r\n	    QEP from model of Los Angeles Hospital building.\r\n	    COEFFS = NLEVP(\'hospital\') constructs a 24-by-24 quadratic matrix\r\n	    polynomial lambda^2*M + lambda*D + K arising in a model of the\r\n	    Los Angeles University Hospital building.  There are 8 floors,\r\n	    each with 3 degrees of freedom.\r\n	    The matrices are returned in a cell array: COEFFS = {K, D, M}.\r\n	    This problem has the properties pep, qep, real.\r\n	     </span>		    <span style=\"margin-top:2em; display:block;\">\r\n	    Reference:\r\n	    Y. Chahlaoui and P. M. Van Dooren. A collection of benchmark examples\r\n	    for model reduction of linear time invariant dynamical systems.\r\n	    MIMS EPrint 2008.22, Manchester Institute for Mathematical Sciences,\r\n	    The University of Manchester, UK, 2002.\r\n	    </span>\r\n',0,16,0),(164,'','Loaded String','		  <span>\r\n		  REP from finite element model of a loaded vibrating string.\r\n		  COEFFS = NLEVP(\'loaded_string\',N,KAPPA) generates an N-by-N rational\r\n		  matrix function A - lambda*B + lambda/(lambda-sigma)*C with sigma = KAPPA/m\r\n		  arising in the finite element discretization of a boundary problem\r\n		  describing the eigenvibration of a string with a load of mass m\r\n		  attached by an elastic spring of stiffness KAPPA.\r\n		  The default values are N = 20, KAPPA = 1.\r\n		  The matrices are returned in a cell array: COEFFS = {A, B, C}.\r\n		  This problem has the properties rep, qep, real, symmetric,\r\n		  parameter_dependent, scalable.\r\n		   </span>		    <span style=\"margin-top:2em; display:block;\">\r\n		  Reference:\r\n		  S. I. Solov\"ev. Preconditioned iterative methods for a class of nonlinear\r\n                  eigenvalue problems. Linear Algebra Appl., 415 (2006), pp.210-229.\r\n                  </span>\r\n		  ',0,16,0),(165,'','MobileManipulator','	    <span>\r\n	      QEP from model of 2-dimensional 3-link mobile manipulator.\r\n	      Generates a 5x5 quadratic matrix\r\n	      polynomial lambda^2*M + lambda*D + K arising from the modelling as a\r\n	      time-invariant descriptor control system of a two-dimensional three-link\r\n	      mobile manipulator.\r\n	      The matrices are returned in a cell array: coeffs = {K, D, M}.\r\n	      This problem has the properties pep, qep, real.\r\n		</span>		    <span style=\"margin-top:2em; display:block;\">\r\n		References:\r\n	      R. Byers, C. He, and V. Mehrmann, Where is the Nearest\r\n	         Non-Regular Pencil?, Linear Algebra Appl., 285 (1998), pp. 81-105.\r\n	      N. J. Higham, and F. Tisseur, More on pseudospectra for polynomial\r\n	         eigenvalue problems and applications in control theory,\r\n	         Linear Algebra Appl., 351-352 (2002), pp. 435-453.\r\n		   </span>',0,16,0),(166,'','Orr Sommerfeld','		  <span>\r\n		  Quartic PEP arising from Orr-Sommerfeld equation.\r\n		  Returns the coefficients of\r\n		  an N-by-N quartic matrix polynomial\r\n		  P(lambda) = lambda^4*A4+lambda^3*A3+lambda^2*A2+ lambda*A1 + A0\r\n		  arising from the spatial stability analysis of the Orr-Sommerfeld equation.\r\n		  The parameter R is the Reynolds number of the problem and w the frequency.\r\n		  The default values are N = 64, R = 5772, W = 0.26943.\r\n		  The matrices are returned in a cell array: COEFFS = {A0, A1, A2, A3, A4}.\r\n		  This problem has the properties pep, parameter-dependent, scalable.\r\n		    </span><span style=\"margin-top:2em; display:block;\">\r\n		    Reference:\r\n		F. Tisseur and N. J. Higham, Structured Pseudospectra for\r\n		  Polynomial Eigenvalue Problems, with Applications,\r\n			       SIAM J. Matrix Anal. Appl., 23(1):187-208, 2001.\r\n			       </span>\r\n',0,16,0),(167,'','Power Plant','		  <span>\r\n		  POWER_PLANT   8-by-8 QEP from simplified nuclear power plant problem.\r\n		  Generates the matrices of an 8-by-8\r\n		  quadratic matrix polynomial lambda^2*M+lambda*D+K arising in the study of\r\n		  the dynamic behaviour of a nuclear power plant. The matrices D and M are\r\n		  real symmetric and K is defined as K = (1+i*mu)K0 with K0 real symmetric.\r\n		  The parameter MU describes hysteretic damping added to the model.\r\n		  The default value for MU is 0.2.\r\n		  The matrices are returned in a cell array: COEFFS = {K, D, M}.\r\n		  This problem has the properties pep, qep, symmetric, parameter_dependent.\r\n		    </span><span style=\"margin-top:2em; display:block;\">\r\n		    Reference:\r\n		T. Itoh, Damped vibration mode superposition method for dynamic response\r\n		  analysis, Earthquake Eng. Struct. Dyn. 2 (1973), pp. 45--57\r\n		  F. Tisseur and K. Meerbergen, The quadratic eigenvalue problem, SIAM\r\n		  Rev. 43 (2001), pp. 235--286\r\n		  </span>\r\n',0,16,0),(168,'','Query','No Information',0,16,0),(169,'','Railtrack','	    <span>\r\n	    QEP from study of vibration of rail tracks.\r\n	    Generates the coefficient matrices of the\r\n	    railtrack problem, a quadratic eigenvalue problem\r\n	    (lambda^2 C + lambda B + A)*x = 0,\r\n	    which models vibration of rail tracks under the excitation of high speed\r\n	    trains.  This problem is T-palindromic, i.e., C = A.\' and B = B.\',\r\n	    and has dimension 1005.\r\n	    The matrices are sparse and returned in a cell array: COEFFS = {A, B, C}.\r\n	    This problem has the properties pep, qep, t-palindromic, sparse.\r\n	      </span><span style=\"margin-top:2em; display:block;\">\r\n	      References:\r\n	   A. Hilliges. Numerische L\\\"osung von quadratischen Eigenwertproblemen\r\n	    mit Anwendung in der Schienendynamik. Master\'s thesis, TU Berlin, 2004.\r\n             Andreas Hilliges, Christian Mehl, and Volker Mehrmann. On the\r\n             solution of palindromic eigenvalue problems. In P. Neittaanmaki,\r\n           T. Rossi, S. Korotov, E. Onate, J. Periaux, and D. Knorzer,\r\n           editors, Proceedings of the European Congress on Computational\r\n          Methods in Applied Sciences and Engineering (ECCOMAS 2004),\r\n          Jyvaskyla, Finland, 2004.\r\n          http://www.mit.jyu.fi/eccomas2004/proceedings/proceed.html\r\n          D. Steven Mackey, Niloufer Mackey, Christian Mehl, and Volker Mehrmann.\r\n          Structured polynomial eigenvalue problems: Good vibrations from\r\n           good linearizations. SIAM J. Matrix Anal. Appl., 28(4):1029-1051, 2006.\r\n          </span>\r\n',0,16,0),(170,'','Schrodinger','	  <span>function coeffs = schrodinger(outputdir)\r\n	     QEP from Schrodinger operator.\r\n	     Generates the coefficient matrices of\r\n	     a quadratic matrix polynomial lambda^2*A + lambda*B + C of dimension\r\n	     1998.  The spectrum of this matrix polynomial is the second order\r\n	     spectrum of the Schrodinger operator with nonzero potential,\r\n	     relative to the subspace generated by fourth order Hermite elements\r\n	     on a uniform mesh on the interval [-49,49].\r\n	     The matrices are returned in a cell array: COEFFS = {C, B, A}.\r\n	     This problem has the properties pep, qep, real, symmetric, sparse.\r\n	       </span><span style=\"margin-top:2em; display:block;\">\r\n	       Reference:\r\n	  L. Boulton and M. Levitin, On approximation of the eigenvalues of\r\n	    perturbed periodic Schroedinger operators, J. Phys. A: Math. Theor. 40\r\n	    (2007), pp. 9319--9329\r\n	     </span>',0,16,0),(175,'','Wing','	    <p>\n	    QEP from analysis of oscillations of a wing in an airstream.\n	      COEFFS = NLEVP(\'wing\') generates a 3x3 quadratic matrix\n	      polynomial Q(lambda) = lambda^2*A2 + lambda*A1 + A0 arising from\n	      the analysis of the oscillations of a wing in an airstream.\n	      The matrices are returned in a cell array: COEFFS = {A0, A1, A2}.\n	      This problem has the properties pep, qep, real.\n		 </p><p>\n	      References:\n	      R. A. Frazer, W. J. Duncan, and A. R. Collar, Elementary Matrices\n	         and Some Applications to Dynamics and Differential Equations,\n	         Cambridge University Press, tenth ed., 1938.  1963 printing.\n	      P. Lancaster, Lambda-Matrices and Vibrating Systems, Pergamon Press,\n	         Oxford, 1966, xiii+196 pp. Reprinted by Dover, New York, 2002.\n	      F. Tisseur and N. J. Higham, Structured Pseudospectra for Polynomial\n	         Eigenvalue Problems, with Applications, SIAM J. Matrix Anal. Appl.,\n	         23(1):187-208, 2001\n		    </p>',0,16,0),(177,'','Acoustic Wave','No Information',0,16,0),(178,'','Bicycle','No Information',0,16,0),(180,'','Butterfly','No Information',0,16,0),(181,'','CD Player','No Information',0,16,0),(182,'','Closed Loop','No Information',0,16,0),(183,'','Concrete','No Information',0,16,0),(184,'','Damped Beam','No Information',0,16,0),(185,'','Dirac','No Information',0,16,0),(186,'','Gun','No Information',0,16,0),(187,'','Hospital','No Information',0,16,0),(188,'','Loaded String','No Information',0,16,0),(189,'','MobileManpiulator','No Information',0,16,0),(190,'','Orr Sommerfeld','No Information',0,16,0),(191,'','Power Plant','No Information',0,16,0),(192,'','Query','No Information',0,16,0),(193,'','Railtrack','No Information',0,16,0),(194,'','Schrodinger','No Information',0,16,0),(195,'','Sign','No Information',0,16,0),(196,'','Sleeper','No Information',0,16,0),(197,'','SpringDashpot','No Information',0,16,0),(198,'','String','No Information',0,16,0),(199,'','Wing','No Information',0,16,0),(200,'','Wiresaw','No Information',0,16,0),(206,'','Augmented system matrix','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,19,1),(207,'','Gaussian Elimination Maximum Growth','Matrix giving maximal growth factor for Gaussian elimination\n%               with partial pivoting.',0,19,1),(208,'','Specified Jordan Canonical Form','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,19,1),(209,'','Upper Quasi-triangular Matrix','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,19,1),(210,'','Vandermonde matrix','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,19,1),(211,'','Vec-permutation Matrix','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,19,1),(217,'','MGF Convection-Diffusion','No Information',0,22,0),(218,'','MGF Time Dependent Convection Diffusion','No Information',0,22,0),(219,'/opt/apps/Defiant3.1/rundefiant.py','Defiant Demo','A demonstration of the defiant toolkit. The sample problem has a single producer and a single injector, at opposite corners of a 3D brick domain. \n<br>\nThe equations for water and oil saturation and pressure:\n<br>\n<img src=\"Images/Defiant/water.png\">\n<br>\n<img src=\"Images/Defiant/oil.png\">\n<br>\nare coupled through <img src=\"Images/Defiant/Sw.png\"> and  <img src=\"Images/Defiant/Pw.png\">. \n<br>\nCombining these equations gives a Poisson equation for the pressure in each time step.',0,23,0),(220,'/opt/apps/hp3d_dump/hp3dj/run_hp3d_fichera1.py','Fichera1','None',0,17,0),(221,'/opt/apps/hp3d_dump/hp3dj/run_hp3d_fichera1.py','Fichera2','None',0,17,0),(222,'/opt/apps/hp3d_dump/hp3dj/run_hp3d_fichera3.py','Fichera3','None',0,17,0),(223,'','Shock','None',0,17,0),(224,'','Acoustic Wave','		    <p>\n		    Constructs the matrix polynomial lambda^2*M + lambda*D + K that arises from\n		    the discretization by finite elements of a two-dimensional acoustic\n		    wave equation. The coefficient matrices are N-by-N with\n		    N = N1*(N1-1), H  = 1/N1 being the mesh size.  The damping matrix has the\n		    form Z^(-1)*D, where D is a low rank real symmetric matrix and\n		    the scalar parameter Z is the impedance (possibly complex).\n		    The default values are N1 = 6 (N = 30) and Z = 1.\n		    The matrices are returned in a cell array: COEFFS = {K, D, M};\n	   	    This problem has the properties pep, qep, real symmetric,\n		    parameter-dependent, scalable.\n		    </p>\n		    <p>\n		    Reference:\n		    F. Chaitin-Chatelin and M. B. van Gijzen, Analysis of parameterized\n		    quadratic eigenvalue problems in computational acoustics with homotopic\n		    deviation theory, Numer. Linear Algebra Appl. 13 (2006), pp. 487--512</p>',0,16,0),(225,'','Bicycle','	        <p>\n	        Constructs a 2-by-2 quadratic matrix\n	        polynomial lambda^2*M + lambda*v*C + K0 + v^2*K2 arising in the\n	        study of the dynamic behaviour of a bicycle.\n	        v (default 5) is the forward speed in m/s.\n	        The matrices are returned in a cell array: COEFFS = {K, C, M}.\n	        This problem has the properties pep, qep, real, parameter_dependent.\n		</p>\n		<p>\n	        Reference:\n	        J. P. Meijaard, J. M. Papadopoulos, A. Ruina and A. L. Schwab, Linearized\n	        dynamics equations for the balance and steer of a bycicle: a benchmark\n		and review, Proc. Roy. Soc. London Ser. A, 463(2084):1955-1982, 2007.\n		</p>',0,16,0),(226,'','Bilby','		  <p>\n		  5-by-5 QEP from Bilby population model.\n		  Constructs a 5-by-5 quadratic matrix\n		  polynomial lambda^2*A + lambda*B + C arising in a\n		  quasi-birth-death process model of the population of the greater bilby,\n		  an endangered Australian marsupial.  A and C are both singular.\n		  BETA is a parameter (default: 0.5).		  \n		  This problem has the properties pep, qep, real, parameter-dependent.\n		  </p>\n		  \n		  <p>\n		  Reference:\n		  N. J. Higham and H.-M. Kim, Numerical analysis of a quadratic\n		  matrix equation, IMA J. Numer. Anal., 20(4): 499-519, 2000.\n		  </p>',0,16,0),(227,'','CD Player','	    <p>\n	    QEP from model of CD player.\n	    Constructs a 60-by-60 quadratic matrix\n	    polynomial lambda^2*M + lambda*D + K arising in the\n	    study of a CD player control task.\n	    The matrices are returned in a cell array: COEFFS = {K, D, M}.\n	    This problem has the properties pep, qep, real.\n	    </p>\n	    <p>\n	    Reference:\n	    Y. Chahlaoui and P. M. Van Dooren. A collection of benchmark examples\n	    for model reduction of linear time invariant dynamical systems.\n	    MIMS EPrint 2008.22, Manchester Institute for Mathematical Sciences,\n	    The University of Manchester, UK, 2002.\n	    </p>',0,16,0),(228,'','Closed Loop','		  <p>\n		  2-by-2 QEP associated with closed-loop control system.\n		  Constructs a 2-by-2 quadratic\n		  matrix polynomial lambda^2*A2 + lambda*A1 + A0 associated with a\n		  closed-loop control system with feedback gains 1 and 1+ALPHA.\n		  For 0 < ALPHA < 0.875 all eigenvalues lie inside the unit disc.\n		  The default is ALPHA = 1. The matrices are returned in a cell array:\n		  COEFFS = {A0, A1, A2}.\n		  This problem has the properties pep, qep, real, parameter_dependent.\n		  </p>\n\n		  <p>\n		  Reference:\n		  Francoise Tisseur and Nicholas J. Higham. Structured pseudospectra for\n		  polynomial eigenvalue problems, with applications. SIAM J. Matrix\n		  Anal. Appl., 23(1):187-208, 2001.\n		  </p>',0,16,0),(230,'','Gun','	    <p>\n	    NEP from model of a radio-frequency gun cavity.\n	    Returns 9956-by-9956 matrices\n	    K, M, W1 and W2 for the nonlinear eigenvalue problem defined by\n	    T(lam)*x = [K-lam*M+i*lam^(1/2)*W1+i*(lam-108.8774^2)^(1/2)*W2]x = 0.\n	    The matrices are returned in a cell array: COEFFS = {K,M,W1,W2}.\n	    This problem has the properties nep, sparse.\n	      </p><p>\n	    References:\n	    Ben-Shan Liao, Subspace projection methods for model order reduction and\n	    nonlinear eigenvalue computation, Ph.D Thesis, Department of Mathematics,\n	      University of California at Davis, 2007\n	      </p>',0,16,0),(231,'','MobileManpiulator','	    <p>\n	      QEP from model of 2-dimensional 3-link mobile manipulator.\n	      Generates a 5x5 quadratic matrix\n	      polynomial lambda^2*M + lambda*D + K arising from the modelling as a\n	      time-invariant descriptor control system of a two-dimensional three-link\n	      mobile manipulator.\n	      The matrices are returned in a cell array: coeffs = {K, D, M}.\n	      This problem has the properties pep, qep, real.\n		</p><p>\n		References:\n	      R. Byers, C. He, and V. Mehrmann, Where is the Nearest\n	         Non-Regular Pencil?, Linear Algebra Appl., 285 (1998), pp. 81-105.\n	      N. J. Higham, and F. Tisseur, More on pseudospectra for polynomial\n	         eigenvalue problems and applications in control theory,\n	         Linear Algebra Appl., 351-352 (2002), pp. 435-453.\n		   </p>',0,16,0),(232,'','Orr Sommerfeld','\n		  <p>\n		  Quartic PEP arising from Orr-Sommerfeld equation.\n		  Returns the coefficients of\n		  an N-by-N quartic matrix polynomial\n		  P(lambda) = lambda^4*A4+lambda^3*A3+lambda^2*A2+ lambda*A1 + A0\n		  arising from the spatial stability analysis of the Orr-Sommerfeld equation.\n		  The parameter R is the Reynolds number of the problem and w the frequency.\n		  The default values are N = 64, R = 5772, W = 0.26943.\n		  The matrices are returned in a cell array: COEFFS = {A0, A1, A2, A3, A4}.\n		  This problem has the properties pep, parameter-dependent, scalable.\n		    </p><p>\n		    Reference:\n		F. Tisseur and N. J. Higham, Structured Pseudospectra for\n		  Polynomial Eigenvalue Problems, with Applications,\n			       SIAM J. Matrix Anal. Appl., 23(1):187-208, 2001.\n			       </p>\n',0,16,0),(233,'','Power Plant','		  <p>\n		  POWER_PLANT   8-by-8 QEP from simplified nuclear power plant problem.\n		  Generates the matrices of an 8-by-8\n		  quadratic matrix polynomial lambda^2*M+lambda*D+K arising in the study of\n		  the dynamic behaviour of a nuclear power plant. The matrices D and M are\n		  real symmetric and K is defined as K = (1+i*mu)K0 with K0 real symmetric.\n		  The parameter MU describes hysteretic damping added to the model.\n		  The default value for MU is 0.2.\n		  The matrices are returned in a cell array: COEFFS = {K, D, M}.\n		  This problem has the properties pep, qep, symmetric, parameter_dependent.\n		    </p><p>\n		    Reference:\n		T. Itoh, Damped vibration mode superposition method for dynamic response\n		  analysis, Earthquake Eng. Struct. Dyn. 2 (1973), pp. 45--57\n		  F. Tisseur and K. Meerbergen, The quadratic eigenvalue problem, SIAM\n		  Rev. 43 (2001), pp. 235--286\n		  </p>\n',0,16,0),(234,'','Query','No Information',0,16,0),(235,'','Schrodinger','	  <p>function coeffs = schrodinger(outputdir)\n	     QEP from Schrodinger operator.\n	     Generates the coefficient matrices of\n	     a quadratic matrix polynomial lambda^2*A + lambda*B + C of dimension\n	     1998.  The spectrum of this matrix polynomial is the second order\n	     spectrum of the Schrodinger operator with nonzero potential,\n	     relative to the subspace generated by fourth order Hermite elements\n	     on a uniform mesh on the interval [-49,49].\n	     The matrices are returned in a cell array: COEFFS = {C, B, A}.\n	     This problem has the properties pep, qep, real, symmetric, sparse.\n	       </p><p>\n	       Reference:\n	  L. Boulton and M. Levitin, On approximation of the eigenvalues of\n	    perturbed periodic Schroedinger operators, J. Phys. A: Math. Theor. 40\n	    (2007), pp. 9319--9329\n	     </p>',0,16,0),(236,'','Sign','No Information',0,16,0),(237,'','Sleeper','No Information',0,16,0),(238,'','SpringDashpot','No Information',0,16,0),(239,'','String','No Information',0,16,0),(240,'','Wiresaw','No Information',0,16,0),(241,'/data/install/FEniCS/poisson.py','Poisson','<p>Generates the Poisson equation with a large singularity in the corner.</p>\n',0,24,0),(242,'/data/install/FEniCS/stokes.py','Stokes','<p>Generates a mixed fem system for the Stokes equation</p>',0,24,0),(259,'/opt/apps/vtest/fillone.py','FillOne',' \\[\n\\left(\\, \\sum_{k=1}^n a_k b_k \\right)^2 \\le\n\\left(\\, \\sum_{k=1}^n a_k^2 \\right) \\left(\\, \\sum_{k=1}^n b_k^2 \\right)\\]\n\n',0,27,0),(260,'/data/install/test/dump.py','Output Test','This generator is used for testing building facilities. It gives you a file containing the inputs you give it in JSON format. ',0,1,0),(261,'/bin/true','New_Generator','No Description',NULL,1,0),(262,'/bin/true','New_Generator','No Description',NULL,1,0),(263,'0','Carrie\'s Generator','This is my generator',NULL,31,0),(264,'0','Another Generator','A new thing',NULL,31,0),(265,'0','That\'s a Generator','Carrie',NULL,31,0),(266,'0','That\'s a Generator','Carrie',NULL,31,0),(267,'0','Another Test','Something',NULL,28,0),(268,'0','Some Generator','fdfdfdfd',NULL,28,0),(269,'0','fffffff','dafasfsa',NULL,28,0),(270,'0','dfdaf','dasfdsfsa',NULL,29,0),(271,'0','jjjjjjjjj','lklkjkjljj;k;kjlkj',NULL,28,0),(272,'0','adfafa','dafsafsafssa',NULL,28,0),(273,'0','dafasfsafa','dafdsafsafa',NULL,29,0),(274,'0','dsafdsafsa','dafdafsafda',NULL,29,0),(275,'test_script1.txt','Testing','Test test test',NULL,30,0);
